text:
Democrat obstruction ends today. 

@SenateGOP will break the blockade and move America forward.

Tomorrow, we will vote on a group of 48 nominees that received bipartisan support. Democrats can vote no, but the obstruction is over. https://t.co/S4rJMfQGBt

For decades, noncontroversial nominees moved through the Senate in a timely manner. Democrats destroyed this tradition by treating every Trump nominee as controversial.

@SenateGOP is determined to confirm @POTUS Trump’s nominees.

It is time to change Senate confirmation rules.

Hundreds of thousands of unaccompanied migrant children were lost under Democrats' open-border policies.

@SenateGOP's One Big Beautiful Bill will help fight back against child trafficking in our country.

Thank you @ChuckGrassley for your leadership on this issue. https://t.co/Rm8V9Z1NiB

If Democrats have their way, every working family in America will face a higher tax bill next year.

Republicans are fighting so that waiters, nurses, police officers, and seniors keep more of what they earn.

@SenateGOP will stop the Democrats’ $4 trillion tax increase. https://t.co/Vd40pi1GVa

Democrats apparently want to continue to defend illegal immigrant criminals like Kilmar Abrego Garcia - the "Maryland Man."

He's not a Maryland man, he's a member of MS-13, who Democrats want to bring back to the United States. 

@SenateGOP is ending the lawlessness. https://t.co/OwuDorhxtI

Immigrations and Customs Enforcement reports that there have been over 100,000 deportations in 80 days. 

That is promises kept. 

@POTUS has restored decisive border enforcement.

One year ago, our adversaries were growing bolder, stronger, and more aggressive.

Not anymore. 

@POTUS is reestablishing our military as the most lethal and intimidating force in the world. https://t.co/jGQivKuFfD

Fentanyl trafficking has made every state a border state – even Wyoming.
 
@SenBillCassidy’s bipartisan HALT Fentanyl Act will help turn the tide on the deadly fentanyl epidemic and start cleaning up the border mess left behind by the Biden administration.
https://t.co/JWvTKf8HUU

The Justice Department needs a leader with the qualifications, experience, determination, and moral clarity to keep our country safe. 

@PamBondi is that leader. 

She has my vote for U.S. Attorney General. https://t.co/T3lhMQNJbS

Under the prior administration, we went from a nation of energy dominance to a nation of energy dependence.

America is an energy superpower. We should act like it. 

@DougBurgum and @ChrisAWright_ are America's energy all-stars. I strongly support their nominations. https://t.co/3o4xuan31r

It was an honor to introduce Congressman Lee Zeldin at his confirmation hearing to lead the EPA.

Over the last 4 years, the EPA has been based solely on radical environmentalism. Americans deserve clear rules and common sense.

@leezeldin will correct the course of the EPA. https://t.co/iC0mgc7xU7

President Trump promised bold choices, and Chris Wright delivers.
 
@ENERGY desperately needs a Secretary who prioritizes American energy for our economy and national security. Mr. Wright will ensure that America's energy policy puts Americans first.
https://t.co/RLZNwB5n1M

The people of America voted to get this country back on track.

@SenateGOP is ready to tackle what Americans care about most – high costs and the open border. 

We've been working with @realDonaldTrump's transition team to get to work on day one. https://t.co/hs6wp8ouTZ
